import React from 'react'
import Axios from "axios"
import { API_URL } from "../constants/API"
import { connect } from "react-redux"



class History extends React.Component {

state = {
	transactionList: [],
}


fetchTransactions = () => {
	Axios.get(`${API_URL}/transactions`,{
		params: {
			userId: this.props.userGlobal.id
		}
	})
	.then((result) => {
		this.setState({transactionList: result.data})
		console.log(this.state.transactionList);
	})
	.catch(() => {
		alert("terjadi kesalahan pada server")
	})
}


renderTransactions = () => {

}

componentDidMount() {
	this.fetchTransactions();
}


  render() {
    return (
      <div className="p-5">
        <h1>Transaction History</h1>
        <div className="row mt-5">
        	<div clasName="col-8">
        		<table className="table">
        			<thead className="thead-light">
        				<tr>
        					<th>Transactions Pages</th>
        					<th>Total Items</th>
        					<th>Total Prices</th>
        					<th>Action</th>
        				</tr>
        			</thead>
        			<tbody>
        				<tr>
        					<td>10-3-2001</td>
        					<td>3 Items(s)</td>
        					<td>Rp 12000</td>
        					<td>
        						<button className="btn btn-info">See Details</button>
        					</td>
        				</tr>
        			</tbody>
        		</table>
        	</div>
        	<div className="col-4">
        		<div className="card">
        			<div className="card-header">
        				<strong>Transactions Details</strong>
        			</div>
        			<div className="card-body">
        				<div className="d-flex my-2 flex-row justify-content-between align-items-center">
        					<span className="font font-weight">Kaos Polos Hitam (3)</span>
        					<span>Rp 12000</span>
        				</div>
        			</div>
        		</div>
        	</div>
        </div>
      </div>
    )
  }
}

const mapStateToProps = state => {
	return{
		userGlobal: state.user
	}
}

export default connect(mapStateToProps)(History);
